    "2015-09-26T19:42:22.366812",nt"name": "1998-northeast-noaa-usgs-nasa-airborne-lidar-assessment-of-coastal-erosion-alace-project-for-th",nt"isopen":
    false,nt"url": null,nt"notes": "This data set includes data collected during
    December 1998 and covers coastline in the states of Maryland, New York, Pennsylvania,
    Ohio, and Massachusetts. Maryland coverage is on the eastern shore of the Delmarva
    peninsula, New York coverage is along the barrier islands of Long Island and Lake
    Erie, Ohio and Pennsylvania coverage is along Lake Erie, and Massachusetts coverage
    is on Cape Cod. Laser beach mapping uses a pulsed laser ranging system mounted onboard
    an aircraft to measure ground elevation and coastal topography. The laser emits
    laser beams at high frequency and is directed downward at the earth's surface through
    a port opening in the bottom of the aircraft's fuselage. The laser system records
    the time difference between emission of the laser beam and the reception of the
    reflected laser signal in the aircraft. The aircraft travels over the beach at approximately
    60 meters per second while surveying from the low water line to the landward base
    of the sand dunes.",nt"license_title": null,nt"extras": [{ntt"key":
